%include "common"
;R2 Perfect Tic Tac Toe AI

;r0 	: X move [0-8]
;r1		: Next table address
;r12	: 1 (bit shift)
;r13	: 0 (port addr)

;PORT 0	: 1<<[0-8 = move]	/	1<<9 = AI win	/	1<<10 = DRAW = NoMove

;3x3
;		0	1	2		=  1    2    4
;		3	4	5		=  8   16   32
;		6	7	8		= 64  128  256

entry_point:
		mov		r0, 0xFFFF
		mov		r1, 0x0040	;Set org
		mov		r12,1
		mov		r13,0

.loop:	cmp		r0, 0xFFFF	;Wait for X move.
		je		.loop

		mov		r2, [r1+r0]	;Get 16 bit value
		mov		r3, r2
		cmp		r3, 0xFFE0
		jae		.end		;Check if the game ended or will end after move by O.
		and		r2, 0x000F	;Get move only
		shl		r12, r2		;1<<move
		send	r13, r12	;SEND 0, 1<<move
		mov		r12, 1		;Back to 1
		mov		r1, [r1+r0]	;Get 16 bit value again
		shr		r1, 4		;Get just the next address.
		mov		r0, 0xFFFF	;Reset r0
		jmp		.loop		;Wait for next move

.end:	test	r3, 0x0010	;Check win/draw
		jz		.AI
		send	r13, 1024	;Send draw
		jmp		entry_point	;Start new game
.AI:	and		r3, 0x000F	;Get move
		shl		r12, r3		;1<<move
		or		r12, 512	;1<<move | AI win
		send	r13, r12	;Send 1<<move | AI win
		jmp		entry_point	;Start new game

org		0x0040

;0b AAAA AAAA AAAA BBBB		A = addr of next table		B = [0-8 = move]
;0b 1111 1111 111A BBBB		A = [0 = AI win][1 = DRAW]	B = [0-8 = move]

